import web3 from './web3';
import ElectionFactory from './Build/ElectionFact.json';

console.log('Election Factory is being initialized...');

// Add this console.log to see your contract address
console.log("Deployed contract address should be:", ElectionFactory);
console.log("no1 : ", ElectionFactory?.networks[5777])
// const instance = new web3.eth.Contract(
//     JSON.parse(ElectionFactory.interface),
//     '0x16795911522115Ef7D4F099f1aBe1F76C2dB6AC8'
// );

// console.log('Election Factory initialized at address:', instance.options.address);

// export default instance;


// import web3 from './web3';
// import ElectionFactory from './Build/ElectionFact.json';

// // Debug the imported JSON
// console.log('ElectionFactory JSON:', ElectionFactory);

// Use proper ABI extraction
const contractABI = ElectionFactory.abi ||
    (ElectionFactory.compilerOutput && ElectionFactory.compilerOutput.abi) ||
    (ElectionFactory.metadata && JSON.parse(ElectionFactory.metadata).output.abi);

if (!contractABI) {
    throw new Error("No ABI found in contract JSON");
}

const instance = new web3.eth.Contract(
    contractABI,
    '0x16795911522115Ef7D4F099f1aBe1F76C2dB6AC8'
);

// Verify contract deployment
async function verifyDeployment() {
    const code = await web3.eth.getCode(instance.options.address);
    console.log('Contract deployed:', code !== '0x');
}
verifyDeployment();

export default instance;
